import 'jest';
import Long from 'long';

import { IRandomGen, IRandom, Random, RandomGen, SplitMixGen } from './index';

class StatefulGenFromFunctional implements IRandomGen {
  constructor(private random: Random) {}

  public next(): number {
    const result = this.random.get();
    this.random = this.random.next();
    return result;
  }

  public nextIntegerBetween(min: number, max: number): number {
    const result = this.random.getIntegerBetween(min, max);
    this.random = this.random.next();
    return result;
  }

  public nextLong(): Long {
    const result = this.random.getLong();
    this.random = this.random.next();
    return result;
  }

  public nextInt(): number {
    const result = this.random.getInt();
    this.random = this.random.next();
    return result;
  }

  public split(): IRandomGen {
    const [next, result] = this.random.split();
    this.random = next;
    return new StatefulGenFromFunctional(result);
  }
}

function produceSequential(gen: IRandomGen, n: number): number[] {
  const result: number[] = [];
  for(let i = 0; i < n; ++i) {
    result.push(gen.next());
  }
  return result;
}

function produceSequentialLong(gen: SplitMixGen, n: number): [number, number][] {
  const result: [number, number][] = [];
  for(let i = 0; i < n; ++i) {
    const r = gen.nextLong();
    result.push([r.getHighBitsUnsigned(), r.getLowBitsUnsigned()]);
  }
  return result;
}

function produceTree(gen: IRandomGen, depth: number): number[] {
  const result: number[] = [];
  const loop: (left: IRandomGen, d: number) => void = (left, d) => {
    if (d <= 0) {
      result.push(left.next());
    } else {
      const right = left.split();
      loop(left, d-1);
      loop(right, d-1);
    }
  };
  loop(gen, depth);
  return result;
}

describe('Random matches RandomGen', () => {
  test('seed=42 has correct generator', () => {
    const g = new RandomGen(42) as any;
    expect({ seed: g.seed, gamma: g.gamma })
      .toEqual({ seed: Long.fromString('9297814886316923340', 10), gamma: Long.fromString('13679457532755275413', 10) });
  });

  test('test 10 sequential elements with seed = 1', () => {
    const stateful = new RandomGen(Long.ONE);
    const functional = new StatefulGenFromFunctional(new Random(Long.ONE));
    expect(produceSequential(stateful, 10)).toEqual(produceSequential(functional, 10));
  });

  test('test 100 sequential elements with seed = 1', () => {
    const stateful = new RandomGen(Long.ONE);
    const functional = new StatefulGenFromFunctional(new Random(Long.ONE));
    expect(produceSequential(stateful, 100)).toEqual(produceSequential(functional, 100));
  });

  test('test depth 13 tree with seed = 1', () => {
    const stateful = new RandomGen(Long.ONE);
    const functional = new StatefulGenFromFunctional(new Random(Long.ONE));
    expect(produceTree(stateful, 13)).toEqual(produceTree(functional, 13));
  });
});

