describe('RandomGen matches reference data', () => {
  test('10 sequential integers with seed=1', () => {
    const stateful = new RandomGen(Long.ONE);
    expect(produceSequentialLong(stateful, 10)).toEqual(referenceSequentialSEED1_Short_Int);
  });

  test('10 sequential elements with seed=1', () => {
    const stateful = new RandomGen(Long.ONE);
    expect(produceSequential(stateful, 10)).toEqual(referenceSequentialSEED1_Short);
  });

  test('1000 sequential elements with seed=1', () => {
    const stateful = new RandomGen(Long.ONE);
    expect(produceSequential(stateful, 1000)).toEqual(referenceSequentialSEED1);
  });

  test('12 level complete binary tree split with seed=1', () => {
    const stateful = new RandomGen(Long.ONE);
    expect(produceTree(stateful, 12)).toEqual(referenceTreeSEED1);
  });
});

describe('Examples work as intended', () => {
  const treeOutput = [[[[0.4382465659417025,0.8734631524118771],[0.047765269650215436,0.4964402932473151]],[[0.10112738435461743,0.625463498385489],[0.6710799612764186,0.020432215205735238]]],[[[0.5153629602985077,0.316364087974514],[0.7710383327418728,0.10249903842969221]],[[0.6704038609885928,0.7219432349126184],[0.95580166227448,0.046613679615845616]]]]
  test('Random sequential example', () => {
    const seed = 42;
    const rng = new Random(seed);
    const a = rng.get(); // 0 <= a < 1
    const nextRng = rng.next();
    const b = nextRng.get(); // 0 <= b < 1
    const a2 = rng.get(); // a === a2
    expect([a === a2, a !== b]).toEqual([true, true]);
  });
  test('Random parallel example', async () => {
    const randomTree: (depth: number, rng: Random) => Promise<any> = async (depth, rng) => {
      if (depth <= 0) {
        return rng.get();
      } else {
        const [leftRng, rightRng] = rng.split();
        return await Promise.all([
          randomTree(depth-1, leftRng),
          randomTree(depth-1, rightRng)
        ]);
      }
    };
    const seed = 42;
    expect(await randomTree(4, new Random(seed))).toEqual(treeOutput);
  });
  test('RandomGen sequential example', () => {
    const seed = 42;
    const rng = new RandomGen(seed);
    const a = rng.next(); // 0 <= a < 1
    const b = rng.next(); // 0 <= b < 1
    expect(a !== b).toEqual(true);
  });
  test('RandomGen parallel example', async () => {
    const randomTree: (depth: number, rng: RandomGen) => Promise<any> = async (depth, rng) => {
      if (depth <= 0) {
        return rng.next();
      } else {
        const rightRng = rng.split();
        return await Promise.all([
          randomTree(depth-1, rng),
          randomTree(depth-1, rightRng)
        ]);
      }
    };
    const seed = 42;
    expect(await randomTree(4, new RandomGen(seed))).toEqual(treeOutput);
  });
});

describe('Convenience functions', () => {
  const seed = 42;
  const INT_MAX = Math.pow(2, 31) - 1;
  const INT_MIN = -Math.pow(2, 31);

  test('Random getLong works', () => {
    const rng = new StatefulGenFromFunctional(new Random(seed));
    expect(rng.nextLong() instanceof Long).toBeTruthy();
  });

  test('RandomGen nextLong works', () => {
    const rng = new RandomGen(seed);
    expect(rng.nextLong() instanceof Long).toBeTruthy();
  });

  test('Random getIntegerBetween(0, 100) is int', () => {
    const rng = new StatefulGenFromFunctional(new Random(seed));
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(0, 100);
      expect(n).toEqual(Math.floor(n));
    }
  });

  test('RandomGen nextIntegerBetween(0, 100) is int', () => {
    const rng = new RandomGen(seed);
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(0, 100);
      expect(n).toEqual(Math.floor(n));
    }
  });

  test('Random getIntegerBetween(0, 100) is in range', () => {
    const rng = new StatefulGenFromFunctional(new Random(seed));
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(0, 100);
      expect(n).toBeGreaterThanOrEqual(0);
      expect(n).toBeLessThanOrEqual(100)
    }
  });

  test('RandomGen nextIntegerBetween(0, 100) is in range', () => {
    const rng = new RandomGen(seed);
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(0, 100);
      expect(n).toBeGreaterThanOrEqual(0);
      expect(n).toBeLessThanOrEqual(100)
    }
  });

  test('Random getIntegerBetween(-10, 10) is in range', () => {
    const rng = new StatefulGenFromFunctional(new Random(seed));
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(-10, 10);
      expect(n).toBeGreaterThanOrEqual(-10);
      expect(n).toBeLessThanOrEqual(10)
    }
  });

  test('RandomGen nextIntegerBetween(-10, 10) is in range', () => {
    const rng = new RandomGen(seed);
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(-10, 10);
      expect(n).toBeGreaterThanOrEqual(-10);
      expect(n).toBeLessThanOrEqual(10)
    }
  });

  test('Random getIntegerBetween(10, 20) is in range', () => {
    const rng = new StatefulGenFromFunctional(new Random(seed));
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(10, 20);
      expect(n).toBeGreaterThanOrEqual(10);
      expect(n).toBeLessThanOrEqual(20)
    }
  });

  test('RandomGen nextIntegerBetween(10, 20) is in range', () => {
    const rng = new RandomGen(seed);
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextIntegerBetween(10, 20);
      expect(n).toBeGreaterThanOrEqual(10);
      expect(n).toBeLessThanOrEqual(20)
    }
  });

  test('Random getInt is int', () => {
    const rng = new StatefulGenFromFunctional(new Random(seed));
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextInt();
      expect(n).toEqual(Math.floor(n));
      expect(n).toBeLessThanOrEqual(INT_MAX);
      expect(n).toBeGreaterThanOrEqual(INT_MIN);
    }
  });

  test('RandomGen nextInt is int', () => {
    const rng = new RandomGen(seed);
    for(let i = 0; i < 100; ++i) {
      const n = rng.nextInt();
      expect(n).toEqual(Math.floor(n));
      expect(n).toBeLessThanOrEqual(INT_MAX);
      expect(n).toBeGreaterThanOrEqual(INT_MIN);
    }
  });
});
